import { Typography, Button } from "@material-ui/core";

const AssistanceType = ({ setStep, setFormData }) => {
  return (
    <div align="center">
      <Typography variant="h5">What do you seek?</Typography>
      <Button
        variant="contained"
        onClick={() => {
          setFormData("assistanceType", "counseling");
          setStep(1);
        }}
      >
        Counseling
      </Button>
      <br />
      <Button variant="contained" color="primary" onClick={() => setStep(1)}>
        Legal Guidance
      </Button>
      <br />
      <Button variant="contained" color="secondary" onClick={() => setStep(1)}>
        Legal Action
      </Button>
    </div>
  );
};

export default AssistanceType;
